import App from './App';
import { Routes, Route } from 'react-router-dom';

// URI viewer component 
export default function ReturRnURI() {
 return (
  <Routes>

   <Route path='/' element={<App />}></Route>
   <Route path='about' element={<h1>About</h1>}></Route>

  </Routes>
 );
};
